// SPDX-License-Identifier: MIT

pragma solidity >=0.6.0 <0.8.0;
pragma experimental ABIEncoderV2;

import '@openzeppelin/contracts/token/ERC20/IERC20.sol';
import '@openzeppelin/contracts/math/SafeMath.sol';
import '@openzeppelin/contracts/utils/Address.sol';
import '@openzeppelin/contracts/token/ERC20/SafeERC20.sol';
import '@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol';

import '../interfaces/IAaveLendingPool.sol';
import '../interfaces/ICompoundToken.sol';
import '../interfaces/AToken.sol';
import '../interfaces/ICompoundComptroller.sol';

import '../mics/AddressProvider.sol';
import '../contexts/DataCal.sol';
import '../contexts/FaultTolerance.sol';
import '../contexts/AuthControl.sol';
import '../contexts/Events.sol';

import '../libraries/types/DataTypes.sol';
import '../libraries/types/AddressTypes.sol';

contract LendingStrategyUSDT is Events, AuthControl, DataCal, FaultTolerance {
	using SafeERC20 for IERC20;
	using Address for address;
	using SafeMath for uint256;

	address public controller;
	address public want;
	address public compoundToken;
	address public aavePool;
	address public vault;
	address public compound;
	address public uniswapV2Router02;

	// DataTypes.Lender Lender;

	DataTypes.Lender public provider = DataTypes.Lender.NONE;

	string private COMPOUND_COMPTROLLER = AddressTypes.COMPOUND_COMPTROLLER;

	bool public autoHarvest = true;

	constructor(
		address _vault,
		address _addressProvider,
		address _accessProvider,
		address _controller
	) AuthControl(_accessProvider) DataCal(_addressProvider) {
		vault = _vault;
		controller = _controller;
		want = getUSDT();
		compoundToken = getCompoundUSDT();
		aavePool = getAavePool();
		compound = getCompound();
		uniswapV2Router02 = getUniswapV2Router02();
	}

	modifier onlyAuth() {
		require(ifAdminOrOperator() || msg.sender == controller, 'Caller is not one of admin,operator and controller');
		_;
	}

	function setAutoHarvest(bool _value) public onlyAdmin {
		autoHarvest = _value;
		emit SetAutoHarvest(msg.sender, _value);
	}

	function getName() external pure returns (string memory) {
		return 'LendingStrategyUSDT';
	}

	// Controller | Vault role - withdraw should always return to Vault
	function withdraw(uint256 _amount) public {
		require(msg.sender == controller, '!controller');
		require(vault != address(0), '!vault');
		uint256 _before = balance();
		withdrawSome(_amount.sub(1)); // Rounding problem
		uint256 _diff = balance().sub(_before);
		IERC20(want).safeTransfer(vault, _diff);
	}

	function withdrawAll() public {
		require(msg.sender == controller, '!controller');
		require(vault != address(0), '!vault');
		harvest();
		_withdrawAll();
		IERC20(want).safeTransfer(vault, balance());
	}

	function balanceOf() public view returns (uint256) {
		return calcPoolUnderlying();
	}

	function balance() public view returns (uint256) {
		return IERC20(want).balanceOf(address(this));
	}

	function claimCompound() public {
		ICompoundComptroller(addressProvider.getAddressMap(COMPOUND_COMPTROLLER)).claimComp(address(this));
	}

	function harvest() public onlyAuth {
		if (autoHarvest) {
			if (provider == DataTypes.Lender.COMPOUND) {
				// if provider is compound, clamin
				claimCompound();
				uint256 _compoundBalance = IERC20(compound).balanceOf(address(this));
				if (_compoundBalance > 5e16) {
					IERC20(compound).safeApprove(uniswapV2Router02, _compoundBalance);
					address[] memory path = new address[](2);
					path[0] = compound;
					path[1] = want;
					// swapExactTokensForTokens
					IUniswapV2Router02(uniswapV2Router02).swapExactTokensForTokens(
						_compoundBalance,
						0,
						path,
						vault,
						block.timestamp
					);
				}
			}
		}
	}

	function deposit() public onlyAuth {
		_deposit(recommend());
	}

	function reBalance() public onlyAuth {
		DataTypes.Lender newProvider = recommend();
		require(newProvider != provider, 'Provider is the same');
		_deposit(newProvider);
	}

	function _deposit(DataTypes.Lender newProvider) internal {
		_withdrawAll();
		uint256 _balance = balance().sub(1); // Rounding problem
		require(_balance > 0, 'Not enough balance');
		if (newProvider == DataTypes.Lender.COMPOUND) {
			_supplyCompound(_balance);
		} else if (newProvider == DataTypes.Lender.AAVE) {
			_supplyAave(_balance);
		}
		provider = newProvider;
	}

	function recommend() internal view returns (DataTypes.Lender) {
		DataTypes.Lender newProvider = DataTypes.Lender.NONE;
		uint256 compoundApr = getCompoundUSDTAPY();
		uint256 aaveApr = getAaveAPY(want);
		if (compoundApr >= aaveApr) {
			newProvider = DataTypes.Lender.COMPOUND;
		} else {
			newProvider = DataTypes.Lender.AAVE;
		}
		return newProvider;
	}

	function _withdrawAll() internal {
		uint256 _amount = balanceCompoundUnderlying();
		if (_amount > 1) {
			_withdrawSomeCompound(_amount.sub(1));
		}
		_amount = balanceAaveUnderlying();
		if (_amount > 1) {
			_withdrawAToken(_amount.sub(1));
		}
	}

	function withdrawSome(uint256 _amount) internal {
		if (provider == DataTypes.Lender.COMPOUND) {
			_withdrawSomeCompound(_amount);
		} else if (provider == DataTypes.Lender.AAVE) {
			_withdrawAToken(_amount);
		}
	}

	function _supplyCompound(uint256 _amount) internal {
		IERC20(want).safeApprove(compoundToken, 0);
		IERC20(want).safeApprove(compoundToken, _amount);
		require(ICompoundToken(compoundToken).mint(_amount) == 0, 'COMPOUND:supply failed');
	}

	function _supplyAave(uint256 _amount) internal {
		IERC20(want).safeApprove(aavePool, 0);
		IERC20(want).safeApprove(aavePool, _amount);
		IAaveLendingPool(aavePool).deposit(want, _amount, address(this), 0);
	}

	function _withdrawSomeCompound(uint256 _amount) internal {
		uint256 b = balanceCompound();
		uint256 bT = balanceCompoundUnderlying();
		require(bT >= _amount, 'Insufficient compound funds');
		uint256 _compoundAmount = (b.mul(_amount)).div(bT);
		_withdrawCompound(_compoundAmount);
	}

	function _withdrawCompound(uint256 amount) internal {
		require(ICompoundToken(compoundToken).redeem(amount) == 0, 'COMPOUND: withdraw failed');
	}

	function _withdrawAToken(uint256 _amount) internal {
		require(balanceAaveUnderlying() >= _amount, 'Insufficient atoken funds');
		IAaveLendingPool(aavePool).withdraw(want, _amount, address(this));
	}

	function balanceCompound() public view returns (uint256) {
		return IERC20(compoundToken).balanceOf(address(this));
	}

	function balanceCompoundUnderlying() public view returns (uint256) {
		// Mantisa 1e18 to decimals
		uint256 _balanceCompound = balanceCompound();
		if (_balanceCompound > 0) {
			_balanceCompound = _balanceCompound.mul(ICompoundToken(compoundToken).exchangeRateStored()).div(1e18);
		}
		return _balanceCompound;
	}

	function balanceAaveUnderlying() public view returns (uint256) {
		address aToken = getAaveUSDT();
		return IERC20(aToken).balanceOf(address(this));
	}

	function calcPoolUnderlying() public view returns (uint256) {
		return balanceCompoundUnderlying().add(balanceAaveUnderlying()).add(balance());
	}
}
